import React from 'react';
import '../index.css';

import Header from './components/Header';
import Body from './components/Sun_Body_2';
import Footer from './components/Footer';

function Sun() {
    return (
        <div>
            <Header />
            <Body />
            <Footer />
        </div>
    )
}

export default Sun
